	trainer.on('holding-pose', function(gestureName) {

		var relativeMoveSpeed = moveSpeed * (16 - zoom);
		console.log(relativeMoveSpeed);
		if (gestureName == 'right')		{ longitudeOffset	= relativeMoveSpeed; }
		else if (gestureName == 'left')	{ longitudeOffset	= -relativeMoveSpeed; }
		else if (gestureName == 'up')	{ latitudeOffset	= relativeMoveSpeed; }
	});	

	/*
	 * 
	 */
	trainer.on('released-pose', function(gestureName) { 
		
		latitudeOffset 	= 0.0;
		longitudeOffset = 0.0;
	});
	
	/*
	 * 
	 */
//	trainer.on('beckon', function() { zoom += zoomDiff; mapCanvas.gmap3('get').setZoom(zoom); });
	trainer.on('zoom in', function() { trainer.fire('stop'); zoom += zoomSpeed; mapCanvas.gmap3('get').setZoom(zoom); });
	trainer.on('zoom out', function() { trainer.fire('stop'); zoom -= zoomSpeed; mapCanvas.gmap3('get').setZoom(zoom); });
		
	trainer.on('stop', function() { longitudeOffset = 0.0; latitudeOffset = 0.0; });
	
	/*
	 * 
	 */
//	trainer.on('go away', function() { zoom -= zoomDiff; mapCanvas.gmap3('get').setZoom(zoom); });
	
	/*
	 * 
	 */
	setInterval(function() {

		if (latitudeOffset != 0.0 || longitudeOffset != 0.0) {
			
			latitude  += latitudeOffset;
			longitude += longitudeOffset;
			
			mapCanvas.gmap3('get').setCenter(new google.maps.LatLng(latitude, longitude));
		}

	}, 50);
